import CO2 from "./CO2";
import AirQuality from "./AirQuality";
import classes from "./Air.module.css";
import Card from "../layout/UI/Card";

function Air(props) {
  return (
      <div style={{ display: "grid", gridTemplateColumns: "repeat(3, 1fr)", gridGap: 20 }}>
        <Card>
          <div><AirQuality /></div>
          <div><CO2 /></div>
        </Card>
      </div>
  );
}

export default Air;
